def composite_nums_between_indices(nums):
    composites = set()
    for i in range(10, 101):
        if is_composite(nums[i]):
            composites.add(nums[i])
    return composites

def is_composite(n):
    if n < 4:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return True
    return False
